import {
  React,
  theme,
  calendarStyles,
  moment,
  ThemeProvider,
  Button,
} from "./index.js";

const DayButton = (day) => {
  const classes = calendarStyles();

  const theDay = moment();
  theDay = day;

  return (
    <ThemeProvider theme={theme}>
      <Button className={classes.dayButton}>{day.format("D")}</Button>
    </ThemeProvider>
  );
};

export default DayButton;
